import { Link, useNavigate } from 'react-router-dom'

function Header () {
    return (
        <nav className="nav-bar">
            <p>
                <Link 
                style={isActive => ({
                    color: isActive ? "green" : "blue"
                  })}
                to='/home'>Home</Link>
            </p>
            <p>
                <Link 
                style={{ color: "white" }}
                to='/todolist'>To-do List</Link>
            </p>
            <p>
                <Link 
                style={{ color: "white" }}
                to='/calendar'>Calender</Link>
            </p>
            <p>
                <Link 
                style={{ color: "white" }}
                to='/timer'>Timer</Link>
            </p>
            <p>
                <Link 
                style={{ color: "white" }}
                to='/analytics'>Analytics</Link>
            </p>
            <p>
                <Link 
                style={{ color: "white" }}
                to='/achievements'>Achievements</Link>
            </p>
            <p>
                <Link 
                style={{ color: "white" }}
                to='/about'>About</Link>
            </p>
        </nav>
    )
}

export default Header;
